// src/InfoSection.js
import React from 'react';
import './InfoSection.css'; // Asegúrate de importar los estilos CSS

function InfoSection({ title, content, image, image2 }) {
  return (
    <section className="info-section">
      <img src={image} alt={title} />
      <div className="text">
        <h3>{title}</h3>
        <p>{content}</p>
      </div>
    </section>
  );
}

export default InfoSection;
